import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './Components/Login';
import AdminDashboard from './Components/AdminDashboard';
import StudentDashboard from './Components/StudentDashboard';
import GirlsHostel from './Components/GirlsHostelDetails';
import BoysHostel from './Components/BoysHostelDetails';
import Outsiders from './Components/Outsiders';
import Feedback from './Components/Feedback';
import About from './Components/About';
import Logout from './Components/Logout';

function App() {
  return (
    <Router>
      <Routes>
        {/* Login route */}
        <Route path="/" element={<Login />} />

        {/* Admin routes */}
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/about/Boys-Hostel" element={<BoysHostel />} />
        <Route path="/about/Girls-Hostel" element={<GirlsHostel />} />
        <Route path="/logout" element={<Logout />} />

        {/* Student routes */}
        <Route path="/student-dashboard" element={<StudentDashboard />} />
        <Route path="/registration" element={<Registration />} />
        <Route path="/outsiders" element={<Outsiders />} />
        <Route path="/feedback" element={<Feedback />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </Router>
  );
}

export default App;
